script: |
  super -f text -I q11390.spq | sort > q11390.out

inputs:
  - name: q11390.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE - col1 - - col2 NOT BETWEEN - col1 * + 41 * + - 98 AND col1 / CAST ( - col2 AS INTEGER ) * + 35 + + - col2;
  - name: tab2

outputs:
  - name: q11390.out
    data: |
      46	51	23
      64	77	40
      75	67	58
